import { createIcon } from "../icon/createIcon";

export const SaveIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="SaveIcon">
    <path d="M9 0v1H1v10h10V3h1v9H0V0h9zm0 9V7H3v2h6zM4 1v2h3V1h1v3H3V1h1zm7 1v1h-1V2h1zm-1-1v1H9V1h1zm0 9H2V6h8v4z" />
  </svg>,
  "Save",
  "save"
);
